import React from 'react';
import ReactDOM from 'react-dom';

let curDate = new Date(2021, 2, 10, 7);
curDate = curDate.getHours();
let wish = "";
const cssStyle = {};

if(curDate >= 1 && curDate < 12){
wish="Good Morning";
cssStyle.color = "green";
}else if(curDate >= 12 && curDate < 19){
  wish = "Good Afternoon";
  cssStyle.color = "red";
}else{
  wish = "Good Night";
  cssStyle.color = "blue";
}

ReactDOM.render(
  <h1>hello, <span style={cssStyle}>{wish}</span></h1>,
  document.getElementById("root")
);
